        require(['esri/Map', 'esri/views/MapView', 'esri/Graphic', 'esri/layers/GraphicsLayer'], function(Map, MapView, Graphic, GraphicsLayer) {
            var map = new Map({
                basemap: 'topo-vector',
            })
            map.on('load', function() {
                map.graphics.enableMouseEvents()
            })

            var view = new MapView({
                container: 'viewDiv',
                map: map,
                center: [105.061451, 9.066901], // longitude, latitude Vị trí trung tâm bản đồ
                zoom: 10,
                highlightOptions: {
                    color: '#FFBBFF',
                },
            })
            var createGraphic = function(data) {
                return new Graphic({
                    geometry: data,
                    symbol: data.symbol,
                    attributes: data,
                    popupTemplate: data.popupTemplate,
                })
            }
            var graphicsLayer = new GraphicsLayer()
            jsondata.polygons.forEach(function(data) {
                graphicsLayer.add(createGraphic(data))
            })
            jsondata.lines.forEach(function(data) {
                graphicsLayer.add(createGraphic(data))
            })
            jsondata.points.forEach(function(data) {
                graphicsLayer.add(createGraphic(data))
            })
            map.add(graphicsLayer)
        })
    </script>
